import React, {useState} from 'react'
import { role } from '../constant/constant'

const Home = () => {
  const [text, setText] = useState('');
  console.log(text);
  if(props.role == role.ADMIN){
    setText('Admin');
  } else if(props.role == role.EXPERT){
    setText('Expert');
  } else {
    setText('Guest');
  }
  return (
    <div className='text-center'>{text}</div>
  )
}

export default Home;
